textOriginal:
Eu JAMAIS votaria em um sujeito como Bolsonaro, e sabe porque?

Não sou racista, diante de Deus todos somos iguais;
Não sou machista, respeito muito minha esposa;
Não sou à favor de tortura nem pena de morte, coisas que o Bolsonaro já disse ser à favor;
Não sou à favor de distribuição de armas pra sociedade, sou cristão, e todo cristão que se preze é contra violência;
Não aprovo a divulgação de mentiras como a campanha de Bolsonaro faz, apelando pra terrorismo moral pra assustar os eleitores;
Repudio completamente o tratamento que Bolsonaro reserva aos pobres, tratando todo morador de favela como bandido e toda menina pobre como prostituta;
Repudio as constantes tentativas de Bolsonaro de atacar nossa democracia;
Perdi muitos parentes durante a pandemia ao mesmo tempo que o presidente de meu país fazia campanha contra a vacina e debochava de quem tinha partido;
Não sou à favor do uso político da fé. Fé é algo sagrado e o que esse sujeito faz com a fé alheia é uma canalhice;
Bolsonaro é corrupto, enriqueceu usando política e tem inclusive declarações dele dizendo que é sonegador, que mente, enfim.

Não preciso ser simpatizante de Lula pra repudiar Bolsonaro, basta eu ser ser humano
